import {useParams} from 'react-router-dom';
import axios from 'axios';
const Active=()=>{
  let { token} = useParams()
  //const navigate=useNavigate()
  const sliceToken=token.slice(1)
const user={}
 const handleClick=(e)=>{
 e.preventDefault()  
axios.post("http://localhost:3001/active",{token:sliceToken})
  .then(data=>alert(data.message))
 .catch(err=>alert(err.message))
 }
  return <>
<button className="bg-blue-300 px-2 hover:bg-yellow-400" onClick={handleClick}>azim</button>
  </>
}
export default Active;
